void splashCompleta()
{
    char buf[20000];

    if(setvbuf(stdout, buf, _IOFBF, sizeof buf)) {
        perror("Falha em alterar o buffer de texto.");
        return;
    }

    splash1();
    fflush(stdout);
    clearScreen();
    splash2();
    fflush(stdout);
    clearScreen();
    splash3();
    fflush(stdout);
    clearScreen();
    splash4();
    fflush(stdout);
    clearScreen();
    splash5();
    fflush(stdout);
    clearScreen();
    splash6();
    fflush(stdout);
    clearScreen();
    splash7();
    fflush(stdout);
    clearScreen();
    splash8();
    fflush(stdout);
    clearScreen();
    splash9();
    fflush(stdout);
    clearScreen();
    splash1();
    fflush(stdout);

    if(setvbuf(stdout, NULL, _IONBF, 0)) {
        perror("Falha em alterar o buffer de texto.");
        return;
    }
}
